import React from 'react';

const Feed = ({ content, contentSnippet, title, link, date }) => {
  let formatted = { day: "numeric", month: "long", year: "numeric" }
  let articleDate = new Date(date).toLocaleDateString("en-GB", formatted)
  return (
    <div>
      <h3>{title}</h3>
      
      <p>{articleDate}</p>
      <p>{link}</p>
    </div>
  );
};

export default Feed;
